PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE md5 (md5sum1 INTEGER NOT NULL, md5sum2 INTEGER NOT NULL, dup5cnt INTEGER, last_updated REAL, inow REAL DEFAULT (STRFTIME('%Y-%m-%d %H:%M:%f', 'NOW')));
CREATE INDEX md5_dup    ON md5 (dup5cnt);
CREATE UNIQUE INDEX md5_md5sum ON md5 (md5sum1,md5sum2);
CREATE TRIGGER md5_lastupdated  AFTER UPDATE OF md5sum1, md5sum2 ON md5 FOR EACH ROW BEGIN     UPDATE md5 SET last_updated=DATETIME() WHERE rowid=OLD.rowid ; END;
COMMIT;
